INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(8, 'Fullmetal Alchemist - tome 01', '2351420179', 'Kurokawa', 2, 'En voulant ressusciter leur mère, Edward et Alphonse Elric utilisent une technique alchimique interdite : la transmutation humaine. Seulement, l\'expérience tourne mal : Edward perd un bras et une jambe et Alphonse, son corps, son esprit se retrouvant prisonnier d\'une armure. Devenu un alchimiste d\'État, Edward, surnommé le Fullmetal Alchemist, se lance, avec l\'aide de son frère, à la recherche de la pierre philosophale, seule chance de retrouver leurs corps. Les deux frères commencent à enquêter sur un homme étrange, \" le fondateur \", qui passe pour un faiseur de miracles...', 1, );
INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(9, 'Fullmetal Alchemist - tome 02', '2351420187', 'Kurokawa', 2, 'En voulant ressusciter leur mère, Edward et Alphonse Elric utilisent une technique alchimique interdite : la transmutation humaine. Seulement, l\'expérience tourne mal : Edward perd un bras et une jambe et Alphonse, son corps, son esprit se retrouvant prisonnier d\'une armure. Devenu un alchimiste d\'État, Edward, surnommé le Fullmetal Alchemist, se lance, avec l\'aide de son frère, à la recherche de la pierre philosophale, seule chance de retrouver leurs corps. Les deux frères commencent à enquêter sur un homme étrange, \" le fondateur \", qui passe pour un faiseur de miracles...', 1, );
INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(10, 'Hunter X Hunter - Tome 1', '2871292663', 'Kana', 3, 'Dans les pas de son père, Gon quitte son village pour se présenter au difficile examen des hunters. En chemin, Gon se fera des amis. Mais survivront-ils à la première épreuve face à des participants particulièrement dangereux... ?! Si quelques adversaires se montrent impitoyables dès le début, d\'autres comme Hisoka le magicien font preuve d\'un cruauté pour le moins inquiétante...', 1, );
INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(11, 'Hunter X Hunter - Tome 2', '2871292671', 'Kana', 3, 'Le récit s\'étoffe au fur et à mesure qu\'apparaissent de nouveaux personnages secondaires. On notera surtout le mystérieux Hisoka dont la puissance semble sans limites et les motivations, inattendues.', 1, );
INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(12, 'Tome 1 - Planète Dakoï', '2877645630', 'Soleil Productions', 4, 'Après des siècles de combats féroces entre les trois secteurs de l\'univers connu, une paix précaire règne enfin…\r\nAux quatre coins de cet univers, des enfants arrivent à la conscience l\'un de l\'autre.\r\nQuels liens les unissent au Space Sniper DRAGAN PREKO, lieutenant des armées d\'élite de l\'alliance terrienne envoyé en mission suicide sur la planète maudite du plus petit secteur… la Planète Dakoï ?', 2, );
INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(13, 'Tome 2 - Secteur WBH3', '2877646602', 'Soleil Productions', 4, '«Cinq enfants dieux naîtront, rassemblés, de leurs mains, des univers créeront, quatre seront bons, un ne le sera pas, l\'âme du Kookaburra en eux s\'éveillera et les appellera. » Telle est la prédiction, vieille de 20 000 ans qui sillonne l\'espace. L\'Alliance terrienne, les Amazones et les dangereux Dakoïds se livrent à une guerre intergalactique pour maîtriser ce pouvoir. Dans cette lutte, le space sniper Dragan Preko, son acolyte Skullface, la belle et dangereuse amazone Taman Khâ et le dernier des Chevaliers-sorciers vont s\'unir pour retrouver les enfants de la Prophétie. L\'aube du Kookaburra est proche...', 2, );
INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(16, 'Au coeur de la vague', 'B08BTWPLTB', 'Les Arènes', NULL, 'Une pionnière de la chirurgie réparatrice.\nChappatte est en contact quotidien avec des\ngens au front de l\'épidémie de Covid-19 : un chef\ndes soins intensifs, un épidémiologiste réputé (et\ninventeur du gel hydroalcoolique), une infirmière\n– personnages principaux auxquels s\'ajoutent\ndes voix secondaires (policier, travailleuse sociale,\netc). Chappatte a tenu un journal de ces échanges\ntéléphoniques, complétés de visites de terrain, pour\nen tirer un reportage BD unique : la chronique en\ntemps réel d\'une épidémie en 2020.\nLes dessins de presse de Chappatte publiés pendant\nla crise complètent et enrichissent le récit, et y\ninstillent une dose d\'humour bienvenue.\nÀ travers les dessins et témoignages d\'Au coeur de la\nvague, on revit les moments forts d\'un des printemps\nles plus bizarres de l\'histoire de l\'humanité : la peur\nomniprésente, les préparatifs, la gestion de la crise,\nles traces que cette première vague laissera, les\nconséquences sociales et humaines qu\'on entrevoit\ndéjà...\nC\'est une histoire universelle, au croisement de\nl\'intime et du collectif.', 2, );
INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(17, 'Charlie remonte le temps', '2700041259', 'Gründ', 5, 'Tout en conservant l\'humour de l\'album original, cette nouvelle édition met au défi, une fois de plus, votre sens de l\'observation. Il faut bien sûr retrouver Charlie qui a changé de place dans chaque scène, mais aussi Félicie, Pouah, Blanchebarbe et Ouaf, ainsi qu\'une foule d\'objets cachés dans toutes les pages. Alors n\'hésitez pas à vous plonger dans cette irrésistible relecture de l\'Histoire à l\'humour délicieusement décalé. Bon courage et surtout ouvrez l\'œil !', 2, );
INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(18, 'Le Livre Magique - 25 ans', '2324002051', 'Gründ', 5, 'Attention à vous, Charliemaniques, car ce livre est magique !\nVous y trouverez bien des univers différents mais toujours\naussi délirants ! Ouvrez l\'oeil et surtout, repérez Charlie !', 2, );
INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(19, 'Où est Charlie ? À Hollywood', '2700041275', 'Gründ', 5, 'Avec un humour hors du commun, cet album met au défi, une fois de plus, votre sens de l\'observation. Il faut bien sûr retrouver Charlie qui a changé de place dans chaque scène, mais aussi Félicie, Pouah, Blanchebarbe et Ouaf, ainsi qu\'une foule d\'objets cachés dans toutes les pages. Cette fois-ci Charlie est à Hollywood et le monde du cinéma est en pleine ébullition ! Vous verrez toutes les équipes techniques ainsi que les coulisses. Charlie décrochera-t-il un rôle ? Pour le savoir, ayez du courage et surtout ouvrez l\'œil !\n(Si Charlie est a Hollywood alors on sait où il est... Ce livre n\'a aucun sens... 0/cestquandlescoursenpresentielheuu)', 2, );
INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(20, 'Où est Charlie ? Le Voyage Fantastique', '2700041267', 'Gründ', 5, 'Tout en conservant l\'humour de l\'album original, cette nouvelle édition met au défi, une fois de plus, votre sens de l\'observation. Il faut bien sûr retrouver Charlie qui a changé de place dans chaque scène, mais aussi Félicie, Pouah, Blanchebarbe et Ouaf, ainsi qu\'une foule d\'objets cachés dans toutes les pages. Alors n\'hésitez pas - ou peut être un peu quand même - à vous plonger dans ce monde fantastique où vous assisterez entre autres à un bal des vampires, à une frénésie de tapis volants et où vous apprendrez qu\'il existe, comble d\'ironie, un pays des Charlie. Bon courage et surtout ouvrez l\'œil !', 2, );
INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(21, 'Où est Charlie ? La très effrayante aventure', '2324026678', 'Gründ', 5, 'Plongez dans une effrayante aventure Où est Charlie ? avec une torche magique !\nOserez-vous braver l\'obscurité et aller à la rencontre des créatures de la nuit ?\nVous connaissez Charlie, ses amis et toutes les fabuleuses quêtes dans lesquelles ils vous emmènent ? Avec ce beau livre, retrouvez une aventure inédite et encore plus amusante avec des scènes plongées dans le noir. Saurez-vous utiliser la torche magique à glisser entre les pages pour retrouver les personnages et tous les objets cachés dans le décor ?\nBonne chance !', 2, );
INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(22, 'Où est Charlie ? Le Carnet Secret', '2700027639', 'Gründ', 5, 'Le 23 septembre est paru le 7e grand album de Charlie : \" Le Carnet secret\". Ce nouveau tome de Martin Handford réserve de belles surprises : en plus d\'incroyables planches Charlie fourmillantes et extravagantes (où l\'on croise des dinosaures, des chevaliers enragés, des défilés militaires, ou encore un labyrinthe infernal), on y trouve un giga jeu de la jungle à découper, un cirque à détacher et à animer, et une enveloppe étoilée où tout ranger lorsque le jeu est terminé. Et n\'oubliez pas de traquer, sur chaque page, la minuscule feuille de papier qu\'il a laissé tomber de son précieux carnet...', 2, );
INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(23, 'Où est Charlie ? La Grande Expo !', '2700013867', 'Gründ', 5, 'L\'album indémodable pour tous les fans !\n\nCe nouvel album a été en 2006 l\'un des grands événements dans le monde de l\'édition pour la jeunesse. Charlie fait partie du cercle restreint des personnages favoris des enfants. Le concept associe un aspect ludique (voire souvent hilarant !) à un autre plus pédagogique (chaque album est un formidable outil pour développer le sens de l\'observation de l\'enfant). Sans doute est-ce ce savant mélange qui garantit la longévité du succès : Charlie a eu 20 ans en 2007 !', 2, );
INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(24, 'Tu mourras moins bête, Tome 1 : La science, c\'est pas du cinéma !', '2359102206', 'Ankama', 6, 'Tu mourras moins bête est un blog de vulgarisation scientifique en bande dessinée. Son auteure, Marion Montaigne, y aborde la science sous un angle humoristique, mais toujours dans un souci d\'exactitude scientifique et une certaine pédagogie. Le premier tome de la bande dessinée : La science, c\'est pas du cinéma ! pointe de manière comique les aberrations scientifiques qui parsèment les films d\'action et de science-fiction (Chérie, j\'ai rétréci les gosses, Volte/Face, Indiana Jones...) ou encore les séries TV comme Les Experts.\nChaque article commence par une carte postale dans laquelle un lecteur (virtuel) pose une question existentielle : \"Quand y aura-t-il des ascenseurs pour l\'espace ?\", \"Quand est-ce qu\'on pourra acheter des sabres laser sur eBay ?\", \"C\'est quoi l\'apoptose ?\". Une petite prof à moustache y répond avec un humour décalé et farfelu. Le but à la fin de l\'article : avoir un peu appris et beaucoup ri !', 2, );
INSERT INTO `album` (`album_id`, `album_title`, `album_isbn`, `album_publisher`, `series_id`, `album_description`, `category_id`, `album_cover`) VALUES
(25, 'Tu mourras moins bête, Tome 2 - Quoi de neuf, Docteur Moustache ?', '2359102931', 'Ankama', 6, 'Après avoir brillamment démystifié la science au cinéma, le Professeur Moustache s\'attaque à... votre corps ! Si vous croyez que l\'apoptose est une maladie des pieds ou si pour vous le «stade anal» est un lieu de concert de 100 000 personnes, alors ce livre est fait pour vous ! Méchants virus et vilaines bactéries, psychologie et scientifiques un peu cinglés : pour passer son doctorat les doigts dans le nez ou simplement pour briller en société, Tu Mourras moins bête, c\'est excellent pour la santé ! Grâce à son programme «cinq rires et légumes par jour», le Professeur Moustache vous promet un esprit sain dans un cornichon !', 2, );
